import React from 'react';
import Typewriter from './Typewriter';
import './Typewriter.css';  // Ensure the CSS is imported

const App = () => {
  return (
    <div className="app-container">
      <Typewriter text="Hello, welcome to my portfolio!" speed={100} />
    </div>
  );
};

export default App;
